<html>
    <head>
        <style>
            body{margin: 0; background: #f2f2f2;font-family: sans-serif}
            #header{
                padding: 10px; background: #fff;
            }
            #imageId{margin:10px auto; display: block; float: none; background: #fff;padding: 3px;border-radius: 3px; border: 1px solid #ddd;max-height: calc(100vh - 154px)}
            #errorMsg{ font-size: 60px; color: tomato;opacity: 0.5; text-align: center;height: calc(100vh - 124px); padding: 50px 0;box-sizing: border-box; font-family: sans-serif}
            #footer{background: #fff; }
            #footer p{margin: 0; font-size: 14px;text-align: center;color: #666;padding: 18px;}
        </style>
    </head>
    <script>
        var screenShotObj = null
        
        // updateImgOnDOM - changes image at every 5 sec
        function updateImgOnDOM() {
            setInterval(() => {
                document.getElementById("imageId").setAttribute("src","http://" + screenShotObj.result +"? t = " +new Date().getTime())
            }, 5000)
        }

        // showImg - loads image on DOM
        function showImg() {
            document.getElementById("imageId").setAttribute("src","http://" + screenShotObj.result +"? t = " +new Date().getTime())
            updateImgOnDOM()
        }

        // getImageUrl - get image screenshot url
        function getImageUrl() {
            var xhttp = new XMLHttpRequest();
            xhttp.onreadystatechange = function() {
                if (this.readyState == 4 && this.status == 200) {
                    document.getElementById("imageId").style.display = "block";
                    screenShotObj = JSON.parse(this.responseText)
                    // document.getElementById("errorMsg").innerHTML = ""
                    document.getElementById("errorMsg").style.display = "none";
                    showImg()
                } else {
                    document.getElementById("errorMsg").innerHTML = "Something went wrong"
                    document.getElementById("imageId").style.display = "none";
                }
            };
            xhttp.open("POST", "/o/mql", false);
            xhttp.setRequestHeader("service-header", "GetCurrentScreenShot")
            xhttp.send();
        }
    </script>
